import React from 'react'

function CollectionItem({ imageUrl, name, price }) {
    return (
        <div className='collection-item'>
            <img src={imageUrl} alt="" className='collection-item-image' />
            <div
                className="collection-item-image"
                style={{ backgroundImage: `url(${imageUrl})` }} />
            <button className='collection-item-button' >add to cart</button>
            <p className='collection-item-name' >{name} </p>
            <p className='collection-item-price' >{price} </p>
        </div>
    )
}

export default CollectionItem;
